Enums are a user-defined type that can have upto 256 members. They are declared using the enum keyword. Each member of an enum corresponds to an integer value, starting from 0. However, each member can be referenced directly by using its' explicit name. Consider this example: // SPDX-License-Identifier: MIT
pragma solidity ^0.8.19; contract TestEnum { // Define an enum named Directions enum Directions { Center, Up, Down, Left, Right } // Declare a state variable of type Directions with default value (Center, the first enum member) Directions public defaultDirection; // Declare and initialize another state variable Directions public setDirection = Directions.Right; // Change the direction function changeDirection(Directions newDirection) public { setDirection = newDirection; } // Get the maximum value of the Directions enum (i.e., Right in this case) function getMaxEnumValue() public pure returns (Directions) { return type(Directions).max; }
}

